import { useState } from "react";
import {
  Card,
  Icon,
  IconButton,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Tooltip,
} from "@mui/material";
import ShareIcon from "@mui/icons-material/Share";
import ArgonBox from "components/ArgonBox";
import ArgonTypography from "components/ArgonTypography";
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";

function FlaggedInstitutions() {
  const [institutions] = useState([
    { name: "Elim Kpachudu Hotel", type: "Hotel", reason: "License Expired", date: "2024-01-10" },
    { name: "Jossy Royal Hotel", type: "Hotel", reason: "Unpaid PAYE Tax", date: "2024-01-09" },
    { name: "Semshak Hotel", type: "Hotel", reason: "License Expired", date: "2024-01-08" },
    { name: "Fatima Private School", type: "School", reason: "Unpaid PAYE Tax", date: "2024-01-07" },
    { name: "Saints Academy", type: "School", reason: "License Expired", date: "2024-01-06" },
    { name: "Jinkai Hospital", type: "Hospital", reason: "License Expired", date: "2024-01-05" },
  ]);

  const handleShare = () => {
    // Implement sharing functionality
    console.log("Sharing with law enforcement...");
  };

  return (
    <DashboardLayout>
      <DashboardNavbar />
      <ArgonBox py={3}>
        <ArgonBox mb={3}>
          <Card>
            <ArgonBox display="flex" justifyContent="space-between" alignItems="center" p={3}>
              <ArgonBox>
                <ArgonTypography variant="h6" gutterBottom>
                  Flagged Institutions
                </ArgonTypography>
                <ArgonTypography variant="button" fontWeight="regular" color="text">
                  Institutions flagged for non-compliance
                </ArgonTypography>
              </ArgonBox>
              <Tooltip title="Share with law enforcement" placement="left">
                <IconButton onClick={handleShare} color="primary">
                  <ShareIcon />
                </IconButton>
              </Tooltip>
            </ArgonBox>
            <ArgonBox px={3} pb={3}>
              <TableContainer>
                <Table>
                  <TableHead>
                    <TableRow>
                      <TableCell 
                        sx={{ 
                          pl: 2,
                          width: "30%",
                          borderBottom: "none",
                          paddingBottom: "8px",
                          color: "text.secondary"
                        }}
                      >
                        Name
                      </TableCell>
                      <TableCell 
                        sx={{ 
                          width: "15%",
                          borderBottom: "none",
                          paddingBottom: "8px",
                          color: "text.secondary"
                        }}
                      >
                        Type
                      </TableCell>
                      <TableCell 
                        sx={{ 
                          width: "25%",
                          borderBottom: "none",
                          paddingBottom: "8px",
                          color: "text.secondary"
                        }}
                      >
                        Reason
                      </TableCell>
                      <TableCell 
                        sx={{ 
                          width: "20%",
                          borderBottom: "none",
                          paddingBottom: "8px",
                          color: "text.secondary"
                        }}
                      >
                        Date Flagged
                      </TableCell>
                      <TableCell 
                        sx={{ 
                          width: "10%",
                          borderBottom: "none",
                          paddingBottom: "8px",
                          color: "text.secondary",
                          textAlign: "center"
                        }}
                      >
                        Actions
                      </TableCell>
                    </TableRow>
                  </TableHead>
                  <TableBody>
                    {institutions.map((institution) => (
                      <TableRow 
                        key={institution.name}
                        sx={{
                          borderBottom: "1px solid #eee"
                        }}
                      >
                        <TableCell 
                          sx={{ 
                            pl: 2,
                            py: 1.5
                          }}
                        >
                          <ArgonTypography variant="button" color="dark">
                            {institution.name}
                          </ArgonTypography>
                        </TableCell>
                        <TableCell sx={{ py: 1.5 }}>
                          <ArgonTypography variant="button" color="text">
                            {institution.type}
                          </ArgonTypography>
                        </TableCell>
                        <TableCell sx={{ py: 1.5 }}>
                          <ArgonTypography variant="button" color="text">
                            {institution.reason}
                          </ArgonTypography>
                        </TableCell>
                        <TableCell sx={{ py: 1.5 }}>
                          <ArgonTypography variant="button" color="text">
                            {institution.date}
                          </ArgonTypography>
                        </TableCell>
                        <TableCell sx={{ py: 1.5, textAlign: "center" }}>
                          <IconButton 
                            size="small" 
                            color="info"
                            sx={{ 
                              '&:hover': { 
                                backgroundColor: 'transparent' 
                              } 
                            }}
                          >
                            <Icon sx={{ fontSize: "1.1rem" }}>visibility</Icon>
                          </IconButton>
                        </TableCell>
                      </TableRow>
                    ))}
                  </TableBody>
                </Table>
              </TableContainer>
            </ArgonBox>
          </Card>
        </ArgonBox>
      </ArgonBox>
    </DashboardLayout>
  );
}

export default FlaggedInstitutions;
